import React from 'react'
import OrgUser from '../OrgUser/OrgUser'

function OrgUsers() {
    return (
        <div className="orgusers-container">
            <h1>Users</h1>
            <div className="orgusers-container-inner">
                <OrgUser />
            </div>
        </div>
    )
}

export default OrgUsers
